contracts/MooveToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MooveToken is ERC721, Ownable {
    event NFTVehicleCreated(string indexed name, string indexed model);
    event NFTVehicleBuyed(uint256 indexed idVehicle, address indexed owner);
    event NFTVehicleTransferred(
        uint256 idVehicle,
        address indexed from,
        address indexed to
    );
    event NFTAuctionsVehicles(string indexed name, string indexed model);
    event VehicleExpired(uint256 indexed idVehicle);

    struct Vehicle {
        uint256 id;
        string name;
        string model;
        uint256 priceVehicle;
        bool available;
        address owner;
        uint256 willEndAt;
    }

    address private _owner;

    mapping(uint256 => Vehicle) public detailsVehicle;
    mapping(uint256 => bool) public availableVehicle;

    mapping(address => uint256[]) internal purchasedVehiclesByAccount;
    mapping(address => uint256[]) internal purchasedAuctionVehiclesByAccount;

    uint256[] internal allVehicle;
    uint256[] internal vehiclesPurchased;

    uint256[] internal allAuctionsVehicles;
    uint256[] internal auctionVehiclePurchased;

    constructor(
        string memory _nameToken,
        string memory _symbolToken
    ) ERC721(_nameToken, _symbolToken) Ownable(msg.sender) {
        _owner = msg.sender;
    }

    function addVehicle(
        uint256 _id,
        string memory _name,
        string memory _model,
        uint256 _priceVehicle
    ) external onlyOwner {
        detailsVehicle[_id] = Vehicle({
            id: _id,
            name: _name,
            model: _model,
            priceVehicle: _priceVehicle,
            available: true,
            owner: msg.sender,
            willEndAt: 0
        });
        availableVehicle[_id] = true;
        allVehicle.push(_id);
        _safeMint(msg.sender, _id);
        emit NFTVehicleCreated(_name, _model);
    }

    function addVehicleAuctions(
        uint256 _id,
        string memory _name,
        string memory _model
    ) external onlyOwner {
        detailsVehicle[_id] = Vehicle({
            id: _id,
            name: _name,
            model: _model,
            priceVehicle: 0,
            available: true,
            owner: msg.sender,
            willEndAt: 0
        });
        availableVehicle[_id] = true;
        allAuctionsVehicles.push(_id);
        _safeMint(msg.sender, _id);
        emit NFTAuctionsVehicles(_name, _model);
    }

    function buyNFTVehicle(uint256 _idVehicle) external payable {
        bool found = false;
        uint256 indexVehicle;

        for (uint i = 0; i < allVehicle.length; i++) {
            if (allVehicle[i] == _idVehicle) {
                found = true;
                indexVehicle = i;
                break;
            }
        }

        uint256 priceVehicle = detailsVehicle[_idVehicle].priceVehicle;
        address ownerVehicle = detailsVehicle[_idVehicle].owner;

        require(found == true, "Vehicle doesn't found");
        require(
            detailsVehicle[_idVehicle].owner == _owner,
            "The vehicle has already been taken by another user"
        );
        require(
            msg.value >= priceVehicle,
            "Doesn't have enough funds to buy this vehicle"
        );

        _approve(msg.sender, _idVehicle, ownerVehicle);

        transferFrom(ownerVehicle, msg.sender, _idVehicle);

        detailsVehicle[_idVehicle].available = false;
        detailsVehicle[_idVehicle].owner = msg.sender;
        detailsVehicle[_idVehicle].willEndAt = block.timestamp + 1 days;
        availableVehicle[_idVehicle] = false;
        purchasedVehiclesByAccount[msg.sender].push(_idVehicle);

        removeVehicleFromAllVehicleArray(_idVehicle);

        emit NFTVehicleBuyed(_idVehicle, msg.sender);
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) public override {
        super.transferFrom(_from, _to, _tokenId);
        detailsVehicle[_tokenId].owner = _to;
        emit NFTVehicleTransferred(_tokenId, _from, _to);
    }

    function expiryCheck(uint256 _idVehicle) external onlyOwner {
        bool found = false;
        bool expired = false;

        for (uint256 i = 0; i < vehiclesPurchased.length; i++) {
            if (vehiclesPurchased[i] == _idVehicle) {
                found = true;
                break;
            }
        }

        if (block.timestamp > detailsVehicle[_idVehicle].willEndAt) {
            expired = true;
        }

        require(found == true, "Vehicle doesn't found");
        require(expired == true, "The subscription has not yet expired");

        address ownerVehicle = detailsVehicle[_idVehicle].owner;

        removePurchasedVehicleByAccount(_idVehicle, ownerVehicle);

        _approve(msg.sender, _idVehicle, ownerVehicle);

        transferFrom(ownerVehicle, msg.sender, _idVehicle);

        detailsVehicle[_idVehicle].available = true;
        detailsVehicle[_idVehicle].owner = msg.sender;
        detailsVehicle[_idVehicle].willEndAt = 0;

        availableVehicle[_idVehicle] = true;

        removeVehicleFromVehiclePurchasedArray(_idVehicle);

        emit VehicleExpired(_idVehicle);
    }

    function removeVehicleFromAllVehicleArray(uint256 _idVehicle) internal {
        uint256 index;
        bool found = false;
        for (uint256 i = 0; i < allVehicle.length; i++) {
            if (allVehicle[i] == _idVehicle) {
                index = i;
                found = true;
                break;
            }
        }
        require(found == true);
        allVehicle[index] = allVehicle[allVehicle.length - 1];
        allVehicle.pop();
        vehiclesPurchased.push(_idVehicle);
    }

    function removeVehicleFromVehiclePurchasedArray(
        uint256 _idVehicle
    ) internal {
        uint256 index;
        bool found = false;
        for (uint256 i = 0; i < vehiclesPurchased.length; i++) {
            if (vehiclesPurchased[i] == _idVehicle) {
                index = i;
                found = true;
                break;
            }
        }
        require(found == true);
        vehiclesPurchased[index] = vehiclesPurchased[
            vehiclesPurchased.length - 1
        ];
        vehiclesPurchased.pop();
        allVehicle.push(_idVehicle);
    }

    function removePurchasedVehicleByAccount(
        uint256 _idVehicle,
        address _ownerNFT
    ) internal {
        uint256 index;
        bool found = false;
        for (
            uint256 i = 0;
            i < purchasedVehiclesByAccount[_ownerNFT].length;
            i++
        ) {
            if (purchasedVehiclesByAccount[_ownerNFT][i] == _idVehicle) {
                index = i;
                found = true;
                break;
            }
        }
        require(found == true);
        purchasedVehiclesByAccount[_ownerNFT][
            index
        ] = purchasedVehiclesByAccount[_ownerNFT][
            purchasedVehiclesByAccount[_ownerNFT].length - 1
        ];
        purchasedVehiclesByAccount[_ownerNFT].pop();
    }

    function arrayVehicleIds() public view returns (uint256[] memory) {
        return allVehicle;
    }

    function arrayVehiclesPurchased() public view returns (uint256[] memory) {
        return vehiclesPurchased;
    }

    function arrayPurchasedVehiclesByAddress(
        address _account
    ) public view returns (uint256[] memory) {
        return purchasedVehiclesByAccount[_account];
    }

    function arrayAuctionsVehicles() public view returns (uint256[] memory) {
        return allAuctionsVehicles;
    }

    function getCurrentTimestamp() public view returns (uint256) {
        return block.timestamp;
    }
}

contracts/VehicleAuctions.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "./MooveToken.sol";

contract VehicleAuctions is MooveToken {
    event AuctionDetails(
        uint256 indexed blockTimeStarted,
        uint256 indexed blockTimeWillEnd,
        uint256 indexed idVehicle
    );
    event AuctionOffer(address indexed signer, uint256 indexed bid);
    event VehicleWithdrawhed(address indexed owner, uint256 indexed idVehicle);

    struct Status {
        uint256 startedAt;
        uint256 willEndAt;
        uint256 winningBid;
        address ownerBid;
    }

    struct RecoverFunds {
        uint256[] totalAmount;
        address[] sender;
    }

    mapping(uint256 => Status) public auctionStatus;
    mapping(uint256 => bool) isStarted;

    mapping(uint256 => RecoverFunds) totalSpend;
    mapping(uint256 => uint256) usersThatOffer;

    mapping(uint256 => bool) withdrawhed;
    mapping(address => bool) fundsRecovered;

    constructor(
        string memory _nameToken,
        string memory _symbolToken
    ) MooveToken(_nameToken, _symbolToken) {}

    function startAuction(
        uint256 _idVehicle
    ) external onlyOwner IdExist(_idVehicle) {
        auctionStatus[_idVehicle] = Status({
            startedAt: block.timestamp,
            willEndAt: block.timestamp + 1 days,
            winningBid: 0,
            ownerBid: address(0)
        });

        isStarted[_idVehicle] = true;

        emit AuctionDetails(
            block.timestamp,
            block.timestamp + 1 days,
            _idVehicle
        );
    }

    function participateAuction(
        uint256 _idVehicle
    ) public payable IdExist(_idVehicle) {
        if (isStarted[_idVehicle] == false) {
            revert("The auction hasn't started yet");
        } else if (block.timestamp > auctionStatus[_idVehicle].willEndAt) {
            revert("The auction has been closed");
        }

        require(
            msg.value > auctionStatus[_idVehicle].winningBid,
            "The ether value you send has be greater than the winning bid"
        );

        auctionStatus[_idVehicle].winningBid = msg.value;
        auctionStatus[_idVehicle].ownerBid = msg.sender;

        usersThatOffer[_idVehicle] += 1;
        totalSpend[_idVehicle].totalAmount.push(msg.value);
        totalSpend[_idVehicle].sender.push(msg.sender);

        emit AuctionOffer(msg.sender, msg.value);
    }

    function withdrawNFT(uint256 _idVehicle) public IdExist(_idVehicle) {
        require(
            block.timestamp > auctionStatus[_idVehicle].willEndAt,
            "Auction for this vehicle hasn't finished"
        );
        require(
            msg.sender == auctionStatus[_idVehicle].ownerBid,
            "Only the winner of the auction can withdrawals"
        );

        address ownerNFT = detailsVehicle[_idVehicle].owner;

        _approve(msg.sender, _idVehicle, ownerNFT);

        transferFrom(ownerNFT, msg.sender, _idVehicle);

        purchasedAuctionVehiclesByAccount[msg.sender].push(_idVehicle);

        removeVehicleFromAllAuctionVehiclesArray(_idVehicle);

        withdrawhed[_idVehicle] = true;

        detailsVehicle[_idVehicle].available = false;
        detailsVehicle[_idVehicle].owner = msg.sender;
        detailsVehicle[_idVehicle].willEndAt = block.timestamp + 7 days;

        emit VehicleWithdrawhed(msg.sender, _idVehicle);
    }

    function recoverFunds(uint256 _idVehicle) public {
        require(
            block.timestamp > auctionStatus[_idVehicle].willEndAt,
            "Auction for this vehicle hasn't finished"
        );

        bool found = false;

        for (uint256 i = 0; i < auctionVehiclePurchased.length; i++) {
            if (auctionVehiclePurchased[i] == _idVehicle) {
                found = true;
                break;
            }
        }

        require(
            found == true,
            "Please wait until the winner collects the vehicle"
        );

        require(
            msg.sender != auctionStatus[_idVehicle].ownerBid,
            "Winner of the auction can't recover funds"
        );

        require(fundsRecovered[msg.sender] == false, "Funds already recovered");

        uint256 allUsers = usersThatOffer[_idVehicle];

        for (uint i = 0; i < allUsers; i++) {
            if (totalSpend[_idVehicle].sender[i] == msg.sender) {
                payable(totalSpend[_idVehicle].sender[i]).transfer(
                    totalSpend[_idVehicle].totalAmount[i]
                );
            }
        }

        fundsRecovered[msg.sender] = true;
    }

    function expiryCheckAuction(uint256 _idVehicle) external onlyOwner {
        bool found = false;
        bool expired = false;

        for (uint256 i = 0; i < auctionVehiclePurchased.length; i++) {
            if (auctionVehiclePurchased[i] == _idVehicle) {
                found = true;
                break;
            }
        }

        if (block.timestamp > detailsVehicle[_idVehicle].willEndAt) {
            expired = true;
        }

        require(found == true, "Vehicle doesn't found");
        require(expired == true, "The subscription has not yet expired");

        address ownerVehicle = detailsVehicle[_idVehicle].owner;

        removePurchasedAuctionVehicleByAccount(_idVehicle, ownerVehicle);

        _approve(msg.sender, _idVehicle, ownerVehicle);

        transferFrom(ownerVehicle, msg.sender, _idVehicle);

        detailsVehicle[_idVehicle].available = true;
        detailsVehicle[_idVehicle].owner = msg.sender;
        detailsVehicle[_idVehicle].willEndAt = 0;
        availableVehicle[_idVehicle] = true;
        isStarted[_idVehicle] = false;

        removeVehicleFromAuctionVehiclePurchasedArray(_idVehicle);

        emit VehicleExpired(_idVehicle);
    }

    function removeVehicleFromAllAuctionVehiclesArray(
        uint256 _idVehicle
    ) internal {
        uint256 index;
        bool found = false;
        for (uint256 i = 0; i < allAuctionsVehicles.length; i++) {
            if (allAuctionsVehicles[i] == _idVehicle) {
                index = i;
                found = true;
                break;
            }
        }
        require(found == true);
        allAuctionsVehicles[index] = allAuctionsVehicles[
            allAuctionsVehicles.length - 1
        ];
        allAuctionsVehicles.pop();
        auctionVehiclePurchased.push(_idVehicle);
    }

    function removeVehicleFromAuctionVehiclePurchasedArray(
        uint256 _idVehicle
    ) internal {
        uint256 index;
        bool found = false;
        for (uint256 i = 0; i < auctionVehiclePurchased.length; i++) {
            if (auctionVehiclePurchased[i] == _idVehicle) {
                index = i;
                found = true;
                break;
            }
        }
        require(found == true);
        auctionVehiclePurchased[index] = auctionVehiclePurchased[
            auctionVehiclePurchased.length - 1
        ];
        auctionVehiclePurchased.pop();
        allAuctionsVehicles.push(_idVehicle);
    }

    function removePurchasedAuctionVehicleByAccount(
        uint256 _idVehicle,
        address _ownerNFT
    ) internal {
        uint256 index;
        bool found = false;
        for (
            uint256 i = 0;
            i < purchasedAuctionVehiclesByAccount[_ownerNFT].length;
            i++
        ) {
            if (purchasedAuctionVehiclesByAccount[_ownerNFT][i] == _idVehicle) {
                index = i;
                found = true;
                break;
            }
        }
        require(found == true);
        purchasedAuctionVehiclesByAccount[_ownerNFT][
            index
        ] = purchasedAuctionVehiclesByAccount[_ownerNFT][
            purchasedAuctionVehiclesByAccount[_ownerNFT].length - 1
        ];
        purchasedAuctionVehiclesByAccount[_ownerNFT].pop();
    }

    function arrayAuctionVehiclePurchased()
        public
        view
        returns (uint256[] memory)
    {
        return auctionVehiclePurchased;
    }

    function arrayAuctionVehiclePurchasedByAddress(
        address _account
    ) public view returns (uint256[] memory) {
        return purchasedAuctionVehiclesByAccount[_account];
    }

    function isAuctionStarted(uint256 _idVehicle) public view returns (bool) {
        return isStarted[_idVehicle];
    }

    function hasWithdrawhed(uint256 _idVehicle) public view returns (bool) {
        return withdrawhed[_idVehicle];
    }

    function hasRecoveredFunds() public view returns (bool) {
        return fundsRecovered[msg.sender];
    }

    modifier IdExist(uint256 _idVehicle) {
        bool found = false;

        for (uint256 i = 0; i < allAuctionsVehicles.length; i++) {
            if (allAuctionsVehicles[i] == _idVehicle) {
                found = true;
                break;
            }
        }

        require(found == true, "Id of the vehicle doesn't found");
        _;
    }
}

